import axios from "axios";
import React, { Component } from "react";

const MANGA = "manga";
const MANGA_READER_APP_URL = "http://localhost:8070";
const MANGA_URL = `${MANGA_READER_APP_URL}/mangas/${MANGA}`;


class MangaService {
    getAllMangas(){
        return axios.get(`${MANGA_READER_APP_URL}/mangas`)
    }
}

export default new MangaService()
